import React from 'react';
import { Link } from 'react-router-dom';

const ListingDisplay = (props) => {

    const renderData = ({listData}) => {
        if(listData){
            if(listData.length > 0){
                return listData.map((item) => {
                    return(
                        <div class="container-item">
                            <div class="item">
                                <div class="res-img"><img src={item.restaurant_thumb} alt=""/></div>
                                <div class="details">
                                    <h1>{item.restaurant_name}</h1>
                                    <p>{item.address}</p>
                                    {/* <div class="star">
                                        <i class="fa-sharp fa-solid fa-star fa-beat" ></i>
                                        <i class="fa-sharp fa-solid fa-star fa-beat" style="color: #ffc800;"></i>
                                        <i class="fa-sharp fa-solid fa-star fa-beat" style="color: #ffc800;"></i>
                                        <i class="fa-sharp fa-regular fa-star-half-stroke fa-beat" style="color: #ffc800;"></i>
                                    </div> */}
                                    <p>{item.cost}</p>
                                    <div class="bttn">
                                        <button class="btn1">Lunch</button>
                                        <button class="btn2">Nightlife</button>
                                        <button class="btn3">South Indian</button>
                                        <button class="btn4">Chinese</button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )
                })
            }
            else{
                return(
                    <h2>No Data Found</h2>
                )
            }
        }
        else{
            return(
                <div>
                    <img src='./images/loader.gif' alt=''/>
                    <h2>Loading......</h2>

                </div>
            )
        }
        
    }

    return(
        <>
           {renderData(props)}
        </>
    )
}

export default ListingDisplay;
